import React from 'react'
import AliceCarousel from 'react-alice-carousel';
import "react-alice-carousel/lib/alice-carousel.css";
import images from '../../pics/*';


const Carousel = () => {
    const carouselImgs = images.map(({id, src, title, description}) => <img key={id} src={src} title={title} alt={description} /> )

    return (
        <>
            <AliceCarousel>
                <carouselImgs classname="sliderimg"> </carouselImgs>
            </AliceCarousel>
        </>
    )
}

export default Carousel
